import data from "../../data";

const DisplayBook = () => {
  return (
    <div className="book">
      <div className="book-image"></div>
      {data.products.map((product) => (
        <div className="book-info">
          <span className="book-title" key={product.tittle}></span>
          <span className="book-author" key={product.author}></span>
          <img src={product.image} height="350px" width="350px" />
          <h4 className="book-price" key={product.price}></h4>
          <button className="addtobuy">Do koszyka</button>
        </div>
      ))}
    </div>
  );
};

export default DisplayBook;
